  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Klamath Basin
  National Wildlife Refuges outlines Refuge accomplishments between July and December
  of 1975. The report begins with an introduction to the Refuge and information about
  weather conditions, habitat conditions, land acquisition activities, and the system
  status. Construction is also described. Habitat management is covered; croplands,
  grasslands, and wetlands are discussed. The wildlife section of the report discusses
  endangered and threatened species, migratory birds, and mammals. Interpretation
  and recreation activities are outlined; topics include information and interpretation
  and law enforcement. Cooperative programs and safety information are attached.\",\n\t\"owner_org\":
